/** @format */

import React from 'react';
import { SupplierList } from '../TextInfo';
import '../App.css';

const SupBlock = (i) => {
	i = i.i;
	const item = SupplierList[i];
	const background = {
		backgroundImage: `url(../images/suppliersLogo/${item.logo})`,
	};
	return (
		<span className='experience'>
			<div className='loc-img supplier' style={background}></div>
			<span className='exp_text'>
				<a target='_blank' rel='noreferrer' href={item.link}>
					<h3 className='work_title'>{item.title}</h3>
				</a>
				<p>{item.subtitle}</p>
			</span>
		</span>
	);
};

export default SupBlock;
